/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `after_consultation_insert` AFTER INSERT ON `consultation` FOR EACH ROW BEGIN
    -- Insert the health_record snapshot into health_record_history
    INSERT INTO `health_record_history` (
        consultation_id,
        patient_id,
        past_medical_history,
        family_history,
        personal_social_history,
        bp,
        temperature,
        pr,
        rr,
        ht,
        wt,
        general_appearance,
        skin,
        head_and_face,
        eyes,
        neck,
        chest_lungs,
        heart,
        abdomen,
        extremities,
        neurologic,
        created_at,
        updated_at,
        allergies
    )
    SELECT
        NEW.consultation_id,
        hr.patient_id,
        hr.past_medical_history,
        hr.family_history,
        hr.personal_social_history,
        hr.bp,
        hr.temperature,
        hr.pr,
        hr.rr,
        hr.ht,
        hr.wt,
        hr.general_appearance,
        hr.skin,
        hr.head_and_face,
        hr.eyes,
        hr.neck,
        hr.chest_lungs,
        hr.heart,
        hr.abdomen,
        hr.extremities,
        hr.neurologic,
        hr.created_at,
        hr.updated_at,
        hr.allergies
    FROM `health_record` AS hr
    WHERE hr.patient_id = NEW.patient_id;
END */;;
DELIMITER ;
